import React from "react";

const productTabs = [
  { id: "featured", title: "Featured" },
  { id: "arrivals", title: "New Arrivals" },
  { id: "onsale", title: "On-Sale" },
];

const products = [
  {
    id: 1,
    tab: "featured",
    primaryImg: "images/product/1.jpg",
    secondaryImg: "images/product/2.jpg",
    category: ["Ring", "Necklace"],
    title: "Necklace",
    oldPrice: "Rs. 45654",
    currentPrice: "Rs. 44015",
    description: "This is a gold ring with diamond and Lorem ipsum dolor sit amet.",
  },
  {
    id: 2,
    tab: "featured",
    primaryImg: "images/product/3.jpg",
    secondaryImg: "images/product/4.jpg",
    category: ["Ring", "Necklace"],
    title: "Earrings",
    oldPrice: null,
    currentPrice: "Rs. 45015",
    description: "This is a gold ring with diamond and Lorem ipsum dolor sit amet.",
  },
  {
    id: 3,
    tab: "arrivals",
    primaryImg: "images/product/5.jpg",
    secondaryImg: "images/product/6.jpg",
    category: ["Bracelet"],
    title: "Bracelet",
    oldPrice: "Rs. 75654",
    currentPrice: "Rs. 74015",
    description: "Elegant bracelet with a timeless design.",
  },
  // Add additional products for other tabs and categories
];

const ProductTab = ({ activeTab, onTabChange }) => {
  return (
    <div className="product_tab_button">
      <ul className="nav" role="tablist">
        {productTabs.map((tab) => (
          <li key={tab.id}>
            <a
              href={`#${tab.id}`}
              className={activeTab === tab.id ? "active" : ""}
              role="tab"
              aria-controls={tab.id}
              aria-selected={activeTab === tab.id}
              onClick={(e) => {
                e.preventDefault();
                onTabChange(tab.id);
              }}
            >
              {tab.title}
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

const ProductCard = ({ product }) => {
  return (
    <div className="custom-col-5">
      <div className="single_product">
        <div className="product_thumb">
          <a href="#" className="primary_img">
            <img src={product.primaryImg} alt={product.title} />
          </a>
          <a href="#" className="secondary_img">
            <img src={product.secondaryImg} alt={product.title} />
          </a>
          <div className="quick_button">
            <a href="#" data-toggle="modal" data-target="#modal_box">
              Quick View
            </a>
          </div>
        </div>
        <div className="product_content">
          <div className="tag_cate">
            {product.category.map((cat, index) => (
              <a href="#" key={index}>
                {cat}
              </a>
            ))}
          </div>
          <h3>
            <a href="#">{product.title}</a>
          </h3>
          <div className="price_box">
            {product.oldPrice && <span className="old_price">{product.oldPrice}</span>}
            <span className="current_price">{product.currentPrice}</span>
          </div>
          <div className="product_hover">
            <div className="product_desc">
              <p>{product.description}</p>
            </div>
            <div className="action_links">
              <ul>
                <li>
                  <a href="#" title="Add to Wishlist">
                    <span className="ion-heart"></span>
                  </a>
                </li>
                <li className="add_to_cart">
                  <a href="#" title="Add to Cart">
                    Add to Cart
                  </a>
                </li>
                <li>
                  <a href="#" title="Compare">
                    <i className="ion-ios-settings-strong"></i>
                  </a>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

const ProductSection = () => {
  const [activeTab, setActiveTab] = React.useState("featured");

  const filteredProducts = products.filter((product) => product.tab === activeTab);

  return (
    <section className="product_section p_section1 product_black_section">
      <div className="container">
        <div className="row">
          <div className="col-12">
            <div className="product_area">
              <ProductTab activeTab={activeTab} onTabChange={setActiveTab} />
              <div className="tab-content">
                <div className="tab-pane fade show active" id={activeTab} role="tabpanel">
                  <div className="product_container">
                    <div className="custom-row product_column3">
                      {filteredProducts.map((product) => (
                        <ProductCard key={product.id} product={product} />
                      ))}
                    </div>
                  </div>
                </div>
                {/* Add similar tab-pane content for arrivals, onsale */}
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ProductSection;
